import axios from "axios"

const find=(formData)=>{
    const city=formData.get("city");
    const filter=null;
    console.log('city',city);   
}

const publish=(formData)=>{
    const city=formData.get("city");
    alert(`Searching for property in ${city}`);   
}

const Search= () => {

    const [formData,setFormdata] = useState({
        location: ''
    });

    const handlechange = (e)=>{
        setFormdata
    }
    const handelsubmit=async(e)=>{
        // console.log(loc)
        e.preventDefault()

        try{
           await axios.post("http://localhost:8000/api/buy/land/pin",{
                // loc
           })
        }
        catch(e){
            console.log(e);
        }
    }

    return ( 
        <>
        <div className="p-5" >
            <h2 className="text-[#00df9a] md:text-6xl  text-center font-tit">Find your dream home</h2>
        </div>
        <div className="w-full border-2 flex items-center">
            <form onSubmit={handelsubmit} className="flex-col margin items-center p-3" >
                <label htmlFor="search" className="text-[#00df9a] ">City :  </label>
                <input type="text" className="bg-[#F7FFF7] rounded"  name="location" value={formData.location} onChange={handlechange}></input>
                <br />
                <input className="text-[#00df9a] rounded " type="submit"  value="search"></input>
                <br/>
                {/* <button className="text-[#00df9a]" formAction={publish} type="submit" name="button" value="submit">Search</button> */}
            </form>
        </div>
        </>
     );
}
 
export default Search;
